def bubble_sort_strings(strings):
    """"""
    n = len(strings)
    for i in range(n):
        swapped = False
        for j in range(0, n - i - 1):
            if strings[j] < strings[j + 1]:
                (strings[j], strings[j + 1]) = (strings[j + 1], strings[j])
                swapped = True
        if not swapped:
            break
    return strings
